import { BsLinkedin, BsGithub } from "react-icons/bs";
import { InkPen } from "../assets/InkPen.jsx";
import { CartoonGuy } from "../assets/CartoonGuy.jsx";
import { useEffect } from "react";
import { gsap } from "gsap";

export const ContactMe = ({ bg }) => {
  const handleResize = () => {
    const drop = document.getElementById("drop");
    const pen = document.getElementById("inkpen");
    const inkSource = document.getElementById("inkSource");

    inkSource.style.position = "absolute";
    inkSource.style.bottom = 5 + "px";
    inkSource.style.left = pen.offsetLeft + "px";

    drop.style.position = "absolute";
    drop.style.bottom = 7 + "px";
    drop.style.left = pen.offsetLeft + "px";
  };

  useEffect(() => {
    window.addEventListener("resize", handleResize);

    return () => {
      window.removeEventListener("resize", handleResize);
    };
  }, []);

  useEffect(() => {
    const drop = document.getElementById("drop");
    const pen = document.getElementById("inkpen");
    const lastBottom = document.getElementById("lastBottom");
    const smallWave = document.getElementById("smallWave");
    const inkSource = document.getElementById("inkSource");

    inkSource.style.position = "absolute";
    inkSource.style.top = pen.offsetHeight - 18 + "px";
    inkSource.style.left = pen.offsetLeft + 8.5 + "px";

    gsap.to(smallWave, {
      keyframes: [
        {
          background: "transparent",
          borderRight: "1px solid black",
          borderLeft: "1px solid black",
          width: "20px",
          height: "8px",
        },
        { width: "30px", height: "18px" },
      ],
      duration: 3,
      repeat: -1,
      ease: "power2.inOut",
    });

    drop.style.position = "absolute";
    drop.style.bottom = 7 + "px";
    drop.style.left = pen.offsetLeft + "px";

    gsap.to(drop, {
      keyframes: [
        { bottom: `${-lastBottom.offsetTop / 1.8}px`, opacity: 0 },
        {
          bottom: `${-lastBottom.offsetTop / 1.8}px`,
          opacity: 1,
          background: "transparent",
          borderTop: "1px solid black",
          borderBottom: "1px solid black",
          width: "40px",
          height: "28px",
          borderRadius: "50%",
        },
        { bottom: `${-lastBottom.offsetTop / 1.8}px`, opacity: 0 },
      ],
      duration: 3,
      repeat: -1,
      ease: "power2.inOut",
    });
  }, []);

  return (
    <div
      id="contactme"
      className={`relative h-screen flex flex-col justify-center gap-20 items-center ${bg} mix-blend-difference`}
    >
      <div className="w-full flex justify-end absolute top-0">
        <div id="inkpen" className="w-60 ">
          <InkPen />
        </div>

        <div id="inkSource" className="bg-black"></div>

        <div
          id="drop"
          className="rounded-full bg-black w-2 h-2 flex justify-center items-center"
        >
          <div id="smallWave" className="rounded-[50%] " />
        </div>
      </div>

      <div className="font-bold flex flex-col items-center justify-center text-center gap-2 text-black z-50">
        <h1 className="text-3xl lg:text-3xl">You are out of Ink</h1>
        <p className="text-xs lg:text-md underline underline-offset-2 decoration-2">
          Contact me if you want more.
        </p>
      </div>

      <div className="flex gap-5 justify-center items-center text-2xl xl:text-3xl z-50">
        <a
          href="https://www.linkedin.com/in/mustapha-chqoubi/"
          aria-label="linkedin"
          target="_blank"
          rel="noreferrer"
          className="cursor-pointer"
        >
          <BsLinkedin />
        </a>
        <a
          href="https://github.com/mustaphachqoubi"
          aria-label="github"
          target="_blank"
          rel="noreferrer"
          className="cursor-pointer"
        >
          <BsGithub />
        </a>
      </div>

      <div
        id="lastBottom"
        className="w-full flex justify-center absolute bottom-0 "
      >
        <div className="w-[10rem] ">
          <CartoonGuy />
        </div>
      </div>
    </div>
  );
};
